This week we're hustling to think of new ideas to make some money. Bugsi came up with the brilliant idea of having a car wash. No body in their right mind would want to get their car washed by a Milf service so we had to disguise ourselves as a car wash for Animal Rights. We finally reeled in a ditsy Milf and gave her the full wax on wax off special.
